(function($) {
  const handleSpeedbumpModalClick = function(title, content) {
    Modal.setContent({
      title: title,
      content: content,
      success: false,
      cancel: false
    }).show();
  }

  Drupal.behaviors.speedBumpModal = {
    attach: function(context, settings) {
      $('a[drupal-data-selector="modal-link"]', context)
        .once('speedBumpModal')
        .each(function() {
          const title = $(this).data('modalTitle');
          const content = $(this).data('modalContent');
          $(this).click(function(e) {
            e.preventDefault();
            if (content) {
              handleSpeedbumpModalClick(title, JSON.parse(content));
            }
          });
      });
    }
  };

})(jQuery);

